September 2018 marked the first of many success stories for SunVoyage Sports 🙏

@shandon.w_ , now an official player of Belenenses SAD U19 🇵🇹, came from Australia 🇦🇺 for a trial through SunVoyage Sports, determined to pursue his dreams. Well, the rest is history ✅ https://zurl.co/Vy3C ... Thank you for your trust and we hope this is just the beginning of a beautiful and long professional career! All the best mate 💪

